import React from 'react'
import {NavItem, NavLink} from 'reactstrap'

function Signup() {
    return(
        <NavItem>
        <NavLink
        style= {{textDecorationSkip: true, color: 'white'}}
        className="paybutton"
        href='/signup'>
        LOG IN
        </NavLink>
        </NavItem>
    )
}

export default Signup
